import UseAuth from "../../auth/UseAuth";
import {useHistory} from 'react-router-dom';

export default function LoginPage() {
    const history = useHistory();
    const auth= UseAuth();
    const handleLogin = () => {
        auth.login();
        history.push("/");
    }
    
    return (
        <div>
            <h1>Login</h1>
            <button onClick={handleLogin}>
                Singin
            </button>
        </div>
    )
}
